  false,\n\t\"url\": null,\n\t\"notes\": \"Several criteria were used for beach selection.
  BEACON 's Coastal Regional Sediment Management Plan included all of the most popular
  beaches in the two counties along with a number of smaller beaches (e.g., u201cOil
  Piersu201d beach) which are under consideration for beach preservation projects.
  While not every single beach is included in the two counties, this study covers
  all of the beaches that should be of interest to regional planners. Appendix C -
  Economic Analysis of the BEACON Coast lists of all the beaches in the study area
  along with a brief description of the beach, in particular its recreational amenities.
  The shapefile was compiled by Noble Consultants and submitted to CSMW by BEACON
  as part of the Central Coast (from Pt. Conception to Pt. Mugu) Coastal Regional
  Sediment Management Plan (2009).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
